  const [content, setContent] = useState("");
  return (
    <div>

      <MapChart setTooltipContent={setContent} />
      <ReactTooltip
        arrowColor="transparent"
        html={true}
      >{content}</ReactTooltip>
    </div>
  );
}

export default App;
